import classes from './MeetupItem.module.css'
function MeetupItem(props) {
	return (
		<li key={props.meetup.id}>
			{/* <div className="item"> */}
			<div>
				{props.meetup.location}
				<img src={props.meetup.image} alt="/" />{" "}
			</div>
      <button>Add Favorite</button>
		</li>
	);
}

export default MeetupItem;
